<script>
  import Help from "./Help.vue";
  import Stats from "./Stats.vue";
  import SoftReset from "./SoftReset.vue";
  import CityGrid from "./CityGrid.vue";
  import Settings from "./Settings.vue";
  import Research from "./Research.vue";
  import Infrastructure from "./Infrastructure.vue";

  export default {
    name: "CityScreen",
    components: {
      Infrastructure,
      Stats,
      SoftReset,
      Help,
      CityGrid,
      Settings,
      Research
    },
    data() {
      return {
        tabcontrols: 0
      }
    },
    computed: {
      tabs: {
        get() {
          let entries = ['Main'];

          if(this.citylevel>2)
            entries.push('CityGrid');

          if(this.citylevel>0)
            entries.push('Infrastructure');

          if(this.citylevel>2)
            entries.push('Research');

          entries.push('Statistics','Settings','Help');
          return entries;
        }
      }
    }
  }
</script>

